$(window).on("load", function () {
    console.log("cmt ava_");
    $("#frmAddComment .group-cm textarea[name=txtContent]").focus(function () {
        $(
            "#frmAddComment .group-cm, #frmAddComment>button, .gendercomment"
        ).removeClass("hide");
        $(this).addClass("extend");
    });
    $("#frmCommentRating textarea[name=txtContent]").focus(function () {
        $("#frmCommentRating >input").removeClass("hide");
        $(this).addClass("extend");
    });
    $("#frmAddComment label").click(function () {
        var n = $(this).data("gender");
        $(".gendercomment label").removeClass("choose");
        $(this).addClass("choose");
        $("input[name=hdGender]").val(n);
    });
    $(".star>a").click(function () {
        var n = $(this).data("index"),
            t = 1;
        $(".star>a").each(function () {
            t <= n ? $(this).addClass("active") : $(this).removeClass("active");
            t++;
        });
        $("input[name=hdScore]").val(n);
    });
    $(".comment-list .child .nds").unbind();
    $(".comment-list .child .nds").click(function () {
        $(this).parents(".child").find(".rcf").is(":visible")
            ? $(this).parents(".child").find(".rcf").hide()
            : $(this).parents(".child").find(".rcf").show();
    });
    $("#frmAddComment input[name=hdUrl]").val(window.location.href);
    setTimeout(refreshCmtAnswer, 3e4);
    checkHashTag();
});
