$(document).ready(function () {
    initGalleryCarosel();
    InitProductOwlCarousel(".listproduct-detail", 6, 20);
    initSlide_Row();
    CheckHash();
    Countdown();
    RunCoupon();
    $(".info-title").click(function (n) {
        n.preventDefault();
        $(this).toggleClass("current");
        $(this).next(".info .info-content").slideToggle();
    });
    $(document).on("click", ".btn-spmarket, .txt-spmarket", function () {
        if ($(this).hasClass("first_call") === !1) {
            var n = $(".select-color li.act").attr("data-code");
            LoadDetailStore(null, n, 3, 0, !0);
            $(this).addClass("first_call");
        } else $(".show-market").addClass("show"), popupShow();
    });
    $(document).on("click", ".show-market-close", function () {
        $(".show-market").removeClass("show");
        popupHide();
    });
    $(document).on("click", ".box_productInfor .select-color li", function () {
        if (!$(this).hasClass("act")) {
            $(".box_productInfor .select-color li").removeClass("act");
            $(this).addClass("act");
            var t = $(this).data("code"),
                i = $(".detail-title").data("id"),
                n = { productId: i, productCode: t };
            GetProductInfor(n);
            GetGallery(n);
        }
    });
    $(document).on("click", ".box_productInfor .select-size li", function () {
        if (!$(this).hasClass("active")) {
            $(".box_productInfor .select-size li").removeClass("active");
            $(this).addClass("active");
            var t = $(this).data("code"),
                i = $(".detail-title").data("id"),
                n = { productId: i, productCode: t };
            GetProductInfor(n);
            GetGallery(n);
        }
    });
    $(document).on("click", ".policy li.doitra a", function (n) {
        $(".policy li.doitra").hasClass("b_popup") &&
            (n.preventDefault(),
                $(".policy li.doitra .wrap_wrtp").show(),
                popupShow());
    });
    $(document).on("click", ".policy li.doitra .wrap_wrtp .closehd", function () {
        $(".policy li.doitra .wrap_wrtp").hide();
        popupHide();
    });
    $(document).on("click", ".select-size .size-top-right", function () {
        $(".select-size .popup-size").show();
        popupShow();
    });
    $(document).on("click", ".select-size .popup-size-close", function () {
        $(".select-size .popup-size").hide();
        popupHide();
    });
    $(document).on("click", "#provincial", function () {
        if ($(this).hasClass("disable")) return !1;
        $(".provincial").toggleClass("crt");
        $(".district").removeClass("crt");
        $(this).toggleClass("act");
        $("#district").removeClass("act");
    });
    $(document).on("click", "#district", function () {
        if ($(this).hasClass("disable")) return !1;
        $(".district").toggleClass("crt");
        $(".provincial").removeClass("crt");
        $(this).toggleClass("act");
        $("#provincial").removeClass("act");
    });
    $(document).on("click", "ul.provincial li", function () {
        $("#provincial").removeClass("act");
        $(".provincial").removeClass("crt");
        var n = $(this).data("id");
        LoadDetailStore(null, GetCodeBoxStore(), n, 0);
    });
    $(document).on("click", "ul.district li", function () {
        $("#district").removeClass("act");
        $(".district").removeClass("crt");
        var n = $("#provincial").data("provinceid"),
            t = $(this).data("id");
        LoadDetailStore(null, GetCodeBoxStore(), n, t);
    });
    $(document).on("click", ".show-market .select-size li", function () {
        if (!$(this).hasClass("active")) {
            var n = $("#provincial").data("provinceid"),
                t = $("#district").data("districtid"),
                i = $(this).data("code");
            LoadDetailStore(null, i, n, t);
        }
    });
    $(document).on("click", ".show-market .select-color li", function () {
        if (!$(this).hasClass("act")) {
            var n = $("#provincial").data("provinceid"),
                t = $("#district").data("districtid"),
                i = $(this).data("code");
            LoadDetailStore(null, i, n, t);
        }
    });
    $(document).on("click", ".market-list .viewStore", function () {
        $(this).hide();
        $(this).next().show();
        $(this).next().next().show();
        $(this).next().next().next().show();
        $(this).next().next().next().next().show();
        $(this).next().next().next().next().next().show();
        $(this).next().next().next().next().next().next().show();
    });
    $(document).on("click", ".market-bottom a", function () {
        GetLocal(NearStore);
    });
    $(document).on("click", ".tab-product span", function () {
        let n = $(this);
        n.hasClass("act") ||
            ($(".tab-product span").removeClass("act"),
                n.addClass("act"),
                $(".detail-product .box-common__content").hide(),
                $(
                    ".detail-product .box-common__content[data-tab=" + n.data("tab") + "]"
                ).show());
    });
    $(document).on("click", ".box-promo label.label-radio", function () {
        $(this)
            .parent()
            .parent()
            .find("label.label-radio.active")
            .removeClass("active");
        $(this).addClass("active");
        var n = "";
        $(".box-promo label.label-radio.active").each(function () {
            n += $(this).html() + " vĂ  ";
        });
        $(".showpromo-radio").removeClass("hide");
        $(".showpromo-radio span").html(n.substring(0, n.length - 4));
        $(this).parents(".box_saving").length > 0
            ? UpdatePromoDetailPromotionSaving($(this))
            : parseInt($(".detail-qtyValue").val()) > 0 && UpdatePromoDetail($(this));
    });
    initMisc();
});
